import React from "react";
import "./App.css";

const App = () => {
  return (
    <div className="container">
      {/* Hexagon with Initials */}
      <svg width="200" height="200" viewBox="0 0 200 200" className="logo">
        {/* Hexagon */}
        <path
          className="hexagon"
          d="M100,20 L170,60 L170,140 L100,180 L30,140 L30,60 Z"
        />
        {/* Initials */}
        <text
          x="50%"
          y="50%"
          textAnchor="middle"
          dominantBaseline="middle"
          className="initials"
        >
          SK
        </text>
      </svg>

      {/* Name */}
      <svg width="400" height="50" viewBox="0 0 400 50" className="name">
        <text
          x="50%"
          y="50%"
          textAnchor="middle"
          dominantBaseline="middle"
          className="nameText"
        >
          Shanwaz Kotekanti
        </text>
      </svg>
    </div>
  );
};

export default App;
